INSERT INTO formatoLibro (id, tipo, observacion, precio) VALUES ('318', 'pasta dura', 'El libro Coraline nos sumerge en un entorno de fantasía y peligro a través de sus doce apasionantes capítulos. Neil Gaiman nos presenta a una protagonista valiente y decidida que debe enfrentarse a sus miedos y desafiar a la malvada otra madre. A lo largo de la historia, Coraline demuestra el poder del ingenio, la valentía y el amor familiar.', '30');
